/* VCD dumping functions */
MOD_mktop_pipelined_mem & mktop_pipelined_mem_backing(tSimStateHdl simHdl)
{
  static MOD_mktop_pipelined_mem *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mktop_pipelined_mem(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
